var currentDayNumber, isFriday, isSaturday, value, isSunday;

// Describe this function...
function setHolidays() {
  console.log('Called setHolidays');
  currentDayNumber = (new Date().getDay() === 0 ? 7 : new Date().getDay());
  isFriday = currentDayNumber == 5;
  isSaturday = currentDayNumber == 6;
  isSunday = currentDayNumber == 7;
  setStateDelayed('0_userdata.0.holiday.today', (isSaturday || isSunday || getState("feiertage.0.heute.boolean").val == true), true, parseInt(0, 10), false);
  setStateDelayed('0_userdata.0.holiday.tomorrow', (isFriday || isSaturday || getState("feiertage.0.morgen.boolean").val == true), true, parseInt(0, 10), false);
  console.log(('Today is localized holiday: ' + String(isSaturday || isSunday || getState("feiertage.0.heute.boolean").val == true)));
  console.log(('Tomorrow is localized holiday: ' + String(isFriday || isSaturday || getState("feiertage.0.morgen.boolean").val == true)));
}


// This script registers states  "0_userdata.0.holiday.tomorrow" and "0_userdata.0.holiday.tomorrow"  to be used for the blind-wake-up program
createState("0_userdata.0.holiday.today", false, JSON.parse('{"name":"Today is a localized holiday?", "type": "boolean"}'), function () {
  on({id: "0_userdata.0.holiday.today", change: "any"}, function (obj) {
    var value = obj.state.val;
    var oldValue = obj.oldState.val;
    console.log(('Today is localized holiday: ' + String(value)));
  });
});
createState("0_userdata.0.holiday.tomorrow", false, JSON.parse('{"name":"Tomorrow is a localized holiday?", "type": "boolean"}'), function () {
  on({id: "0_userdata.0.holiday.tomorrow", change: "any"}, function (obj) {
    var value = obj.state.val;
    var oldValue = obj.oldState.val;
    console.log(('Tomorrow is localized holiday: ' + String(value)));
  });
});
// Initial setup
setHolidays();
// Once a day
schedule("0 0 * * *", function () {
  setHolidays();
});

getState("0_userdata.0.holiday.today").val;

getState("0_userdata.0.holiday.tomorrow").val;

